static QDict<QImage> *lignumCADimage_dict = 0;
static QImage& uic_findImage_lignumCAD( const QString& name )
{
    if ( !lignumCADimage_dict ) {
        lignumCADimage_dict = new QDict<QImage>;
        lignumCADimage_dict->setAutoDelete( TRUE );
    }
    QImage* img = lignumCADimage_dict->find(name);
    if ( !img ) {
        for (int i=0; embed_image_vec[i].data; i++) {
	if ( QString::fromUtf8(embed_image_vec[i].name) == name ) {
	    img = new QImage((uchar*)embed_image_vec[i].data,
			embed_image_vec[i].width,
			embed_image_vec[i].height,
			embed_image_vec[i].depth,
			(QRgb*)embed_image_vec[i].colorTable,
			embed_image_vec[i].numColors,
			QImage::BigEndian
		);
	    if ( embed_image_vec[i].alpha )
	        img->setAlphaBuffer(TRUE);
	    break;
	}
        }
        if ( !img ) {
            static QImage dummy;
            return dummy;
        } else {
            lignumCADimage_dict->insert( name, img );
        }
    }
    return *img;
}

class DesignerMimeSourceFactory_lignumCAD : public QMimeSourceFactory
{
public:
    DesignerMimeSourceFactory_lignumCAD() {}
    const QMimeSource* data( const QString& abs_name ) const {
	QImage img;
	if ( !!abs_name )
	    img = uic_findImage_lignumCAD( abs_name );
	if ( !img.isNull() ) {
	    QMimeSourceFactory::defaultFactory()->setImage( abs_name, img );
	    return QMimeSourceFactory::defaultFactory()->data( abs_name );
	} else {
	    QMimeSourceFactory::removeFactory( (QMimeSourceFactory*)this );
	    const QMimeSource *s = QMimeSourceFactory::defaultFactory()->data( abs_name );
	    QMimeSourceFactory::addFactory( (QMimeSourceFactory*)this );
	    return s;
	}
	return 0;
    };
};
